#
# Structure for table "news"
#

CREATE TABLE `news` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(90) NOT NULL DEFAULT '' COMMENT '新闻标题',
  `content` text NOT NULL COMMENT '新闻内容',
  `img` varchar(255) DEFAULT NULL COMMENT '新闻图片',
  `dep_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '部门id',
  `type_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '类别id',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '发布时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '最后修改时间',
  `publisher` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '发布者staff_id',
  `view_num` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '查看数量',
  `comment_num` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '评论数量',
  `is_slide` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '是否设为轮播图 0:否;1:是',
  `delete_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '删除时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COMMENT='新闻表';

