INSERT INTO `news` VALUES (2,'技术部门周例会','<p>2018年2月6日，技术部门在会议室101举行周例会，请全体成员务必出席！！！</p>','20180306\\5669932b5a2099f5eaae705c58adfe1d.jpg',2,1,1517752215,1520306470,1,113,1,0,0),(3,'部门周例会','2018年2月5日，行政部将在会议室101举行周例会，请全体成员出席！！',NULL,1,1,1517752993,1517752993,5,122,2,0,0),(4,'技术部门项目进度季度汇报','<p>技术部门项目进度季度汇报&nbsp;</p><p>技术部门项目进度季度汇报&nbsp;</p><p>技术部门项目进度季度汇报&nbsp;</p><p>技术部门项目进度季度汇报</p><p>&nbsp;技术部门项目进度季度汇报</p>','20180305\\dc852703de6644ab0411654dc7357937.jpg',2,3,1517834492,1520305637,1,132,2,1,0),(5,'技术部门项目开发进度汇报','<p><span style=\"color: rgb(0, 176, 80);\"><strong>技术部门项目开发进度汇报</strong></span></p><p><span style=\"color: rgb(0, 176, 80);\"><strong>技术部门项目开发进度汇报</strong></span></p><p><span style=\"color: rgb(0, 176, 80);\"><strong>技术部门项目开发进度汇报</strong></span></p><p><span style=\"color: rgb(0, 176, 80);\"></span></p><hr/><p>更新时间：2018-03-06<span style=\"color: rgb(0, 176, 80);\"><strong>11:03:54</strong></span><br/></p><p style=\"text-align: center;\"><span style=\"color: rgb(255, 0, 0);\"><em>技术部门项目开发进度汇报</em></span></p><p style=\"text-align: center;\"><span style=\"color: rgb(255, 0, 0);\"><em>技术部门项目开发进度汇报</em></span></p><p style=\"text-align: center;\"><span style=\"text-decoration: underline;\">技术部门项目开发进度汇报</span></p><p><br/></p>','20180225\\d2e2b69cb015b783d636b0a1704b792e.jpg',2,3,1519212334,1520305517,1,38,0,1,0),(6,'测试测试测试','<p><span style=\"color: rgb(79, 97, 40);\">测试测试测试</span></p><p><span style=\"color: rgb(192, 80, 77);\"><strong><em>测试测试测试</em></strong></span></p><p><span style=\"color: rgb(79, 97, 40);\"><strong>测试测试测试</strong></span></p>','',2,1,1520304926,1520304926,1,6,0,0,0),(7,'十三届全国人大一次会议开幕会','<p style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; margin-bottom: 5px; margin-left: 0px; margin-right: 0px; margin-top: 5px; orphans: 2; text-align: left; text-decoration: none; text-indent: 32px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\">十三届全国人大一次会议应出席代表2980人。5日上午的会议，出席2970人，缺席10人，出席人数符合法定人数。</p><p style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; margin-bottom: 5px; margin-left: 0px; margin-right: 0px; margin-top: 5px; orphans: 2; text-align: left; text-decoration: none; text-indent: 32px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\">大会主席团常务主席、执行主席栗战书主持大会。大会主席团常务主席、执行主席陈希、王晨、曹建明、张春贤、沈跃跃、吉炳轩、艾力更·依明巴海、万鄂湘、陈竺在主席台执行主席席就座。</p><p style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; margin-bottom: 5px; margin-left: 0px; margin-right: 0px; margin-top: 5px; orphans: 2; text-align: left; text-decoration: none; text-indent: 32px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\">习近平、李克强、张德江、俞正声、张高丽、汪洋、王沪宁、赵乐际、韩正和大会主席团成员在主席台就座。</p><p style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; margin-bottom: 5px; margin-left: 0px; margin-right: 0px; margin-top: 5px; orphans: 2; text-align: left; text-decoration: none; text-indent: 32px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\">上午9时，栗战书宣布：中华人民共和国第十三届全国人民代表大会第一次会议开幕。全体起立，在军乐队的伴奏下高唱国歌。</p><p style=\"margin: 5px 0px; text-align: left; color: rgb(0, 0, 0); text-transform: none; text-indent: 32px; letter-spacing: normal; font-family: sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; word-spacing: 0px; white-space: normal; orphans: 2; -webkit-text-stroke-width: 0px; background-color: transparent;\">根据会议议程，李克强代表国务院向大会作政府工作报告。<br/></p>','',1,2,1520306940,1520306940,5,10,3,0,0),(8,'百度云智宁波大数据产业基地开业','<p style=\"margin: 20px 0px; padding: 0px; outline: invert; text-align: justify; color: rgb(51, 51, 51); text-transform: none; text-indent: 2em; letter-spacing: 1px; font-family: 宋体; font-size: 16px; font-style: normal; font-weight: 400; word-spacing: 0px; white-space: normal; orphans: 2; widows: 2; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">6月18日下午，经过半年筹备，百度云智·宁波大数据产业基地正式开业，首批15家百度系及上下游大数据、人工智能企业签约入驻。</p><p style=\"margin: 20px 0px; padding: 0px; outline: none; font-size: 16px; color: rgb(51, 51, 51); font-family: 宋体; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\">　　2016年12月8日，宁波市政府与百度公司签订战略合作协议，由宁波市经信委、宁波保税区、百度公司、宁波赛迪信息技术有限公司四方共同打造的百度云智·宁波大数据产业基地正式落户宁波保税区，这也是百度公司在国内的首个试点示范项目。</p><p style=\"margin: 20px 0px; padding: 0px; outline: none; font-size: 16px; color: rgb(51, 51, 51); font-family: 宋体; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\">　　2017年2月8日，基地运营公司——云智(宁波)大数据产业运营公司正式成立。</p><p style=\"margin: 20px 0px; padding: 0px; outline: none; font-size: 16px; color: rgb(51, 51, 51); font-family: 宋体; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\">　　百度云智(宁波)基地将重点引进三类企业：百度系企业(A类)、利用百度大数据、人工智能技术研发行业大数据应用与服务的上下游成熟企业(B类)、通过百度云智(全球)创新大赛等形式，引进和培育利用基地生态资源的创新型企业或团队(C类)。</p><p style=\"margin: 20px 0px; padding: 0px; outline: none; font-size: 16px; color: rgb(51, 51, 51); font-family: 宋体; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: 1px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\">　　百度云智(宁波)基地、云智(宁波)大数据产业运营公司总经理王洪全表示，百度云智(宁波)基地将利用百度大数据、技术、平台、品牌等资源集聚大数据、人工智能相关企业，培育产业生态链，打造宁波智能经济新的增长引擎；同时，将联合专业资本对入驻的创新项目进行投资，并提供一条龙的专业服务，并为百度在宁波及周边城市合作项目提供支撑和运营服务。</p><p><br/></p>','20180306\\01e129e923d98818d2a1508641457103.jpg',2,4,1520307328,1520307328,5,13,2,1,0),(9,'中国三大运营商确定5G时间表6G研究已开始','<p style=\"text-indent: 2em;\"><span style=\"color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-size: 14px; text-align: justify; text-indent: 28px; background-color: rgb(255, 255, 255);\">在前不久结束的MWC2018上，5G成了全球的一个热门话题，而国内对5G的关注度也是异常地高。实际上，与2G、3G、4G相比，我国在5G方面的布局并不晚于其他国家；而且中国三大运营商在中国5G发展中的角色至关重要，因此它们在5G上的节奏基本上决定了整个中国5G的迈进步伐。</span></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-size: 14px; text-align: justify; text-indent: 28px; background-color: rgb(255, 255, 255);\"></span></p><p style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">在试验计划层面，中国移动宣布，将建设世界上规模最大的5G试验网，并正式公布了2018年5G规模试验计划——将在杭州、上海、广州、苏州、武汉5个城市开展外场测试，每个城市将建设超过100个5G基站；在北京、雄安、天津、福州、重庆、成都、南昌、南宁、深圳、郑州、沈阳、兰州等12个城市进行5G业务和应用示范。</p><p style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; text-align: justify; word-wrap: break-word; word-break: normal; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">在终端层面，中国移动联合全球20家终端产业合作伙伴共同启动【5G终端先行者计划】，这20家企业包括高通、华为、联发科技、紫光展锐、英特尔、三星等6家主流芯片企业，华为、OPPO、vivo、小米、三星、中兴、联想、HTC、海信、TCL等10家主流终端企业，Qorvo、Skyworks、TaiyoYuden及飞骧科技等4家元器件企业.</p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-size: 14px; text-align: justify; text-indent: 28px; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-size: 14px; text-align: justify; text-indent: 28px; background-color: rgb(255, 255, 255);\">总体来看，在国家大力推动5G发展的政策背景下，三大运营商在走向5G商用的道路上不会差得太远，在大体的时间线上相对比较一致：都是在2019年预商用，2020年正式商用。</span></span></p>','20180310\\32627867ef703816e9463fb83849ff87.jpg',2,4,1520649795,1520649795,1,6,1,0,0),(10,'2018年公司发展计划','<ul class=\" list-paddingleft-2\" style=\"list-style-type: square;\"><li><p>2018年公司发展计划</p></li><li><p><span style=\"text-decoration: underline;\">2018年公司发展计划</span></p></li><li><p><span style=\"text-decoration: underline;\">2018年公司发展计划</span></p></li></ul>','',1,2,1521171954,1521171954,5,5,2,0,0),(11,'2018年Q1编程语言排名：JS第一，Swift首进前十','<p style=\"text-indent: 2em;\"><span style=\"color: rgb(37, 37, 37); font-family: &quot;Helvetica Neue&quot;, Helvetica, STheiti, 微软雅黑, 黑体, Arial, Tahoma, sans-serif, serif; background-color: rgb(250, 250, 250);\">进入2018年3月，RedMonk发布了2018年初编程语言排行榜，榜单显示JavaScript依然是最受欢迎的编程语言，仅发布了四年的编程语言苹果Swift已经进入了榜单前十，与苹果Objective-C语言并列。</span></p><p><br/></p><p style=\"margin-top: 0px; margin-bottom: 20px; padding: 0px; color: rgb(37, 37, 37); font-family: &quot;Helvetica Neue&quot;, Helvetica, STheiti, 微软雅黑, 黑体, Arial, Tahoma, sans-serif, serif; white-space: normal; background-color: rgb(250, 250, 250);\"><strong>下面是排名位列前20的编程语言：</strong></p><ol class=\" list-paddingleft-2\" style=\"margin-right: 1.5em; margin-bottom: 20px; margin-left: 2em; padding: 0px; list-style-position: initial; list-style-image: initial; color: rgb(37, 37, 37); font-family: &quot;Helvetica Neue&quot;, Helvetica, STheiti, 微软雅黑, 黑体, Arial, Tahoma, sans-serif, serif; white-space: normal; background-color: rgb(250, 250, 250);\"><li><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">JavaScript&nbsp;</p></li><li><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">Java&nbsp;</p></li><li><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">Python&nbsp;</p></li><li><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">PHP&nbsp;</p></li><li><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">C＃</p></li><li><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">C ++&nbsp;</p></li><li><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">CSS&nbsp;</p></li><li><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">Ruby&nbsp;</p></li><li><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">C&nbsp;</p></li><li><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">Swift 10.Objective-C&nbsp;</p></li><li><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">Shell 12.R&nbsp;</p></li><li><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">TypeScript 14.Scala&nbsp;</p></li><li><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">Go&nbsp;</p></li><li><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">PowerShell&nbsp;</p></li><li><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">Perl&nbsp;</p></li><li><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">Haskell&nbsp;</p></li><li><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">Lua</p></li></ol><p><br/></p>','20180317\\09dd6ccea2f46d882b6f93c6aa0d18e3.png',2,4,1521254968,1521257157,1,9,1,0,0),(12,'新项目立项通知','<p><span style=\"text-decoration: line-through;\"><strong><span style=\"text-decoration: line-through; font-size: 20px;\">新项目立项通知新项目立项通知新项目立项通知</span></strong></span></p><p>2018-03-17</p><p><br/></p>','',2,3,1521257608,1521257608,1,1,0,0,0),(13,'3月XX项目进度汇报','<p>3月XX项目进度汇报3月XX项目进度汇报</p><p>3月XX项目进度汇报</p>','',2,3,1521257685,1521257685,1,2,1,0,0),(14,'3月18日技术部门会议','<p>3月18日技术部门会议</p><p>2018-03-18&nbsp; 9：00 准时参加</p>','',2,1,1521258016,1521258016,1,4,2,0,0),(15,'ThinkPHP5','<p><span style=\"color: rgb(20, 25, 30); font-family: &quot;PingFang SC&quot;, 微软雅黑, &quot;Microsoft YaHei&quot;, Helvetica, &quot;Helvetica Neue&quot;, Tahoma, Arial, sans-serif; font-size: 14px; background-color: rgb(248, 250, 252);\">thinkphp官网在去年的时候发布了tp的颠覆版本thinkphp5,tp5确实比之前的版本好用了很多，增加了很多的一些特性，它采用全新的架构思想，引入了更多的PHP新特性，优化了核心，减少了依赖，实现了真正的惰性加载，支持composer，并针对API开发做了大量的优化工作，包括路由、日志、异常、模型、数据库、模板引擎和验证等模块都已经重构，绝对是新项目的首选</span><br/><br/></p>','20180317\\3b4d98e6e480f80f19269872098c3778.jpg',2,4,1521259241,1521259259,1,8,2,0,0),(16,'2018年软件开发的十个预测','<p style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25.2px; color: rgb(64, 64, 64); white-space: normal; background-color: rgb(250, 250, 250);\">区块链、NLP、AI 驱动的工具、机器学习、无服务器计算和 devops 创新将在 2018 年改变开发者的生活。</p><p style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25.2px; color: rgb(64, 64, 64); white-space: normal; background-color: rgb(250, 250, 250);\">　　开发人员应该对 2018 年的机遇感到兴奋，产品和工具围绕着诸如区块链、聊天机器人、无服务器功能和机器学习等技术在现实世界的项目中变得足够成熟。与此同时，许多开发人员会担心，在不影响安全性和性能的前提下，他们将无法更快地交付代码和功能。但这方面也有好消息。</p><p style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25.2px; color: rgb(64, 64, 64); white-space: normal; background-color: rgb(250, 250, 250);\">　　对于开发人员来说，2018 年的定义是，在抓住转型新机遇的同时，在应对压力的同时，要做得更多，质量更高。以下是有关这些力量将在未来一年如何发挥作用的 10 个预测。</p><p><strong style=\"margin: 0px; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 1.5em; color: rgb(64, 64, 64); white-space: normal; background-color: rgb(250, 250, 250);\">1. 利用区块链的 B2B 交易进入生产阶段</strong></p><p><strong style=\"margin: 0px; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 1.5em; color: rgb(64, 64, 64); white-space: normal; background-color: rgb(250, 250, 250);\">2. 聊天机器人经常与顾客和员工进行真正的对话</strong></p><p><strong style=\"margin: 0px; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 1.5em; color: rgb(64, 64, 64); white-space: normal; background-color: rgb(250, 250, 250);\">3. 按钮消失了：AI 变成了 app 界面</strong></p><p><strong style=\"margin: 0px; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 1.5em; color: rgb(64, 64, 64); white-space: normal; background-color: rgb(250, 250, 250);\">4. 机器学习采用实际的、特定领域的用途</strong></p><p><strong style=\"margin: 0px; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 1.5em; color: rgb(64, 64, 64); white-space: normal; background-color: rgb(250, 250, 250);\">5. DevOps 走向无操作</strong></p><p><strong style=\"margin: 0px; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 1.5em; color: rgb(64, 64, 64); white-space: normal; background-color: rgb(250, 250, 250);\">6. 开源作为一种服务，加速了开源创新的消费</strong></p><p><strong style=\"margin: 0px; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 1.5em; color: rgb(64, 64, 64); white-space: normal; background-color: rgb(250, 250, 250);\">7. 无服务器计算的架构在生产中会变得很大</strong></p><p><strong style=\"margin: 0px; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 1.5em; color: rgb(64, 64, 64); white-space: normal; background-color: rgb(250, 250, 250);\">8. 关于容器的唯一问题是“为什么不呢?”</strong></p><p><strong style=\"margin: 0px; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 1.5em; color: rgb(64, 64, 64); white-space: normal; background-color: rgb(250, 250, 250);\">9. 软件和系统可以自我修复、自我调节和自我管理</strong></p><p><strong style=\"margin: 0px; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 1.5em; color: rgb(64, 64, 64); white-space: normal; background-color: rgb(250, 250, 250);\">10. 高度自动化的安全性和遵从性努力成为开发人员的新同盟</strong></p><p><strong style=\"margin: 0px; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 1.5em; color: rgb(64, 64, 64); white-space: normal; background-color: rgb(250, 250, 250);\"></strong></p><hr/><p>2018-03-17&nbsp; &nbsp;12:23:58<br/></p>','20180317\\9315fa90344b92d9fadbe44507250e57.png',2,4,1521260664,1521260664,1,1,0,1,0);

#
# Structure for table "news_type"
