CREATE TABLE `news_type` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(30) NOT NULL DEFAULT '' COMMENT '类别名称',
  `description` varchar(60) NOT NULL DEFAULT '' COMMENT '备注',
  `news_count` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '新闻数量',
  `delete_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '删除时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='新闻类别表';

