#
# Structure for table "staff"
#

CREATE TABLE `staff` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `job_number` varchar(10) NOT NULL DEFAULT '' COMMENT '工号',
  `name` varchar(20) NOT NULL DEFAULT '' COMMENT '员工姓名',
  `sex` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '性别0:未设置;1:男,2:女',
  `dep_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '所属部门id',
  `job_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '岗位id',
  `province_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '省份id',
  `city_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '城市id',
  `district_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '区县id',
  `mobile` varchar(15) NOT NULL DEFAULT '' COMMENT '手机号',
  `email` varchar(30) NOT NULL DEFAULT '' COMMENT '邮箱',
  `birthday` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '出生日期',
  `employ_date` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '入职日期',
  `avatar` varchar(255) DEFAULT NULL COMMENT '头像',
  `username` varchar(10) NOT NULL DEFAULT '' COMMENT '用户名',
  `password` varchar(60) NOT NULL DEFAULT '' COMMENT '密码(MD5加密)',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '注册时间',
  `last_login_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '最后登录时间',
  `status` tinyint(2) unsigned NOT NULL DEFAULT '1' COMMENT '用户状态 0:禁用 1:启用',
  `online` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '是否在线 0:否;1:是',
  `type` tinyint(2) unsigned NOT NULL DEFAULT '1' COMMENT '用户类型 0:admin;1;普通用户;2:新闻发布者',
  `delete_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '删除时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='员工信息表';

